// Add Event Listener Polyfill
function() {

  return function(el, eventName, fn) {

    if (el.addEventListener) {

      el.addEventListener(eventName, fn);

    } else if (el.attachEvent) {

      el.attachEvent('on' + eventName, function(evt) {

        polyfillHandler(el, eventName, fn);

      });

    } else if (typeof el['on' + eventName] === 'undefined' || el['on' + eventName] === null) {

      el['on' + eventName] = function(evt) {

        polyfillHandler(el, eventName, fn);

      };

    }

  };

  function polyfillHandler(el, evt, fn) {

    // Polyfill for non-standard target
    evt.target = evt.target || evt.srcElement;

    fn.call(el, evt);

  }

}

